import React from "react";
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
} from "@mui/material";
import { useNavigate } from "react-router-dom";

const cards = [
  {
    title: "Card 1",
    description: "Description for card 1",
    image: "https://via.placeholder.com/150",
  },
  {
    title: "Card 2",
    description: "Description for card 2",
    image: "https://via.placeholder.com/150",
  },
  {
    title: "Card 3",
    description: "Description for card 3",
    image: "https://via.placeholder.com/150",
  },
];

const Home = () => {
  const navigate = useNavigate(); // React Router v6 için

  const handleLogout = async () => {
    try {
      // Backend'e logout isteği gönderme
      await axios.post(
        "/logout",
        {},
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem("token")}`, // Token'ı header'a ekleme
          },
        }
      );
      // Token'ı localStorage'dan kaldırma
      localStorage.removeItem("token");
      // Login sayfasına yönlendirme
      navigate("/login");
    } catch (error) {
      console.error("Logout failed:", error);
    }
  };

  return (
    <Container maxWidth="lg" style={{ marginTop: "2rem" }}>
      <Typography variant="h3" component="h1" gutterBottom>
        Welcome to the Home Page
      </Typography>
      <Typography variant="h6" component="p" gutterBottom>
        This is a simple home page designed with Material-UI.
      </Typography>

      <Grid container spacing={4} style={{ marginTop: "2rem" }}>
        {cards.map((card, index) => (
          <Grid item key={index} xs={12} sm={6} md={4}>
            <Card>
              <CardMedia
                component="img"
                height="140"
                image={card.image}
                alt={card.title}
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                  {card.title}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {card.description}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Home;
